import React from 'react';
import './Configuracao.css';
import PatiPiva from '../Imagens/PatiPiva.jpg';
import imagem2 from '../Imagens/imagem2.jpg';

function Hexagon() {
  return (
    <div className="container">
      <div className="hex pos0">
        <img src={imagem1} alt="Imagem 1" />
      </div>
      <div className="hex pos1">
        <img src={imagem2} alt="Imagem 2" />
      </div>
      <div className="hex pos2">
        <img src={imagem1} alt="Imagem 1" />
      </div>
      <div className="hex pos3">
        <img src={imagem2} alt="Imagem 2" />
      </div>
      <div className="hex pos4">
        <img src={imagem1} alt="Imagem 1" />
      </div>
      <div className="hex pos5">
        <img src={imagem2} alt="Imagem 2" />
      </div>
      <div className="hex pos6">
        <img src={imagem1} alt="Imagem 1" />
      </div>
    </div>
  );
}

export default Hexagon;
